// ğŸ¯ AI-ENHANCED PRODUCT MATCHING
const products = $('ğŸ›ï¸ Load Products').all();
const forecastData = $('ğŸ“Š Process Forecasting').first().json;
const session = $('ğŸ¢ Agent Session Init').first().json;

const productMatching = {
  matched_trends: [],
  product_opportunities: [],
  summary: {}
};

// Match products to each trend
forecastData.forecasting_results.trend_forecasts.forEach(forecast => {
  const trendWords = forecast.trend.toLowerCase().split(/\s+/).filter(w => w.length > 2);
  const matchedProducts = [];

  products.forEach(productData => {
    const product = productData.json;
    let matchScore = 0;
    const matchReasons = [];

    // Name matching (highest weight)
    trendWords.forEach(word => {
      if (product.name?.toLowerCase().includes(word)) {
        matchScore += 30;
        matchReasons.push(`Name contains '${word}'`);
      }
      if (product.description?.toLowerCase().includes(word)) {
        matchScore += 20;
        matchReasons.push(`Description matches '${word}'`);
      }
    });

    // Tag matching
    if (product.tags && Array.isArray(product.tags)) {
      product.tags.forEach(tag => {
        trendWords.forEach(word => {
          if (tag.toLowerCase().includes(word)) {
            matchScore += 25;
            matchReasons.push(`Tagged with '${tag}'`);
          }
        });
      });
    }

    // Keyword matching
    if (product.keywords && Array.isArray(product.keywords)) {
      product.keywords.forEach(keyword => {
        trendWords.forEach(word => {
          if (keyword.toLowerCase().includes(word)) {
            matchScore += 20;
            matchReasons.push(`Keyword match: '${keyword}'`);
          }
        });
      });
    }

    // Benefits matching
    if (product.benefits && Array.isArray(product.benefits)) {
      product.benefits.forEach(benefit => {
        trendWords.forEach(word => {
          if (benefit.toLowerCase().includes(word)) {
            matchScore += 15;
            matchReasons.push(`Benefit: ${benefit}`);
          }
        });
      });
    }

    // Only include if score meets threshold
    if (matchScore >= 60) {
      matchedProducts.push({
        product_id: product.id,
        product_name: product.name,
        sku: product.sku,
        match_score: Math.min(100, matchScore),
        match_reasons: matchReasons,
        price: product.price,
        inventory_available: product.inventory_count > 0,
        inventory_count: product.inventory_count,
        category: product.category,
        image_urls: product.image_urls || [],
        product_url: product.product_url
      });
    }
  });

  // Sort by score and limit
  const topMatches = matchedProducts
    .sort((a, b) => b.match_score - a.match_score)
    .slice(0, 5);

  // Generate content strategies
  const contentStrategies = [];
  if (topMatches.length > 0) {
    contentStrategies.push({
      type: 'product_showcase',
      description: `Feature ${topMatches[0].product_name} as the hero product`,
      cta: 'Shop Now'
    });

    if (topMatches.length >= 3) {
      contentStrategies.push({
        type: 'routine_builder',
        description: `Create a complete ${forecast.trend} routine`,
        cta: 'Build Your Routine'
      });
    }

    if (topMatches.some(p => p.inventory_count > 50)) {
      contentStrategies.push({
        type: 'limited_time_offer',
        description: 'Promote high-inventory items with special offers',
        cta: 'Limited Time - 20% Off'
      });
    }
  }

  contentStrategies.push({
    type: 'educational',
    description: `Expert guide to ${forecast.trend}`,
    cta: 'Learn More'
  });

  productMatching.matched_trends.push({
    trend: forecast.trend,
    lifecycle_stage: forecast.lifecycle_stage,
    momentum_score: forecast.momentum_score,
    matched_products: topMatches,
    content_strategies: contentStrategies,
    product_strategy: topMatches.length > 0 
      ? `Leverage ${topMatches.length} products for conversion`
      : 'Focus on educational content to build authority'
  });
});

// Generate summary
productMatching.summary = {
  total_trends: forecastData.forecasting_results.trend_forecasts.length,
  trends_with_products: productMatching.matched_trends.filter(t => t.matched_products.length > 0).length,
  total_products_matched: productMatching.matched_trends.reduce((sum, t) => sum + t.matched_products.length, 0),
  high_confidence_matches: productMatching.matched_trends
    .flatMap(t => t.matched_products)
    .filter(p => p.match_score >= 80).length,
  inventory_opportunities: productMatching.matched_trends
    .flatMap(t => t.matched_products)
    .filter(p => p.inventory_count > 100).length
};

console.log('Product matching complete');
console.log('Trends with products:', productMatching.summary.trends_with_products);
console.log('Total products matched:', productMatching.summary.total_products_matched);

return {
  json: {
    product_matching: productMatching,
    forecasting_data: forecastData,
    session_id: forecastData.session_id
  }
};

// ğŸš« INTELLIGENT DUPLICATE PREVENTION
const productMatching = $('ğŸ¯ Product Matching').first().json;
const existingContent = $('ğŸ“… Check Content').all();
const session = $('ğŸ¢ Agent Session Init').first().json;

const duplicatePrevention = {
  unique_opportunities: [],
  duplicates_found: [],
  content_planning: [],
  summary: {}
};

// Check each trend for duplicates
productMatching.product_matching.matched_trends.forEach(trend => {
  let isDuplicate = false;
  const duplicateMatches = [];

  // Advanced similarity checking
  existingContent.forEach(contentData => {
    const content = contentData.json;

    // Calculate similarity score
    const trendWords = new Set(trend.trend.toLowerCase().split(/\s+/).filter(w => w.length > 2));
    const contentWords = new Set(content.topic_name.toLowerCase().split(/\s+/).filter(w => w.length > 2));

    // Check word overlap
    const intersection = [...trendWords].filter(x => contentWords.has(x));
    const union = new Set([...trendWords, ...contentWords]);
    const jaccardSimilarity = (intersection.length / union.size) * 100;

    // Check semantic similarity (simple approach)
    const semanticMatch = (
      (trend.trend.toLowerCase().includes('glass') && content.topic_name.toLowerCase().includes('glass')) ||
      (trend.trend.toLowerCase().includes('sustainable') && content.topic_name.toLowerCase().includes('eco')) ||
      (trend.trend.toLowerCase().includes('personalized') && content.topic_name.toLowerCase().includes('custom'))
    );

    const finalSimilarity = semanticMatch ? Math.min(100, jaccardSimilarity + 20) : jaccardSimilarity;

    if (finalSimilarity >= 70) {
      isDuplicate = true;
      duplicateMatches.push({
        existing_topic: content.topic_name,
        platform: content.platform,
        scheduled_date: content.scheduled_date,
        similarity_score: Math.round(finalSimilarity)
      });
    }
  });

  if (!isDuplicate) {
    // Plan content variations for different platforms
    const contentVariations = [];
    const baseDate = new Date();

    // Instagram - immediate for high momentum
    if (trend.momentum_score >= 80 || trend.lifecycle_stage === 'growth') {
      contentVariations.push({
        platform: 'instagram',
        content_type: 'carousel',
        scheduled_date: new Date(baseDate.getTime() + 1 * 24 * 60 * 60 * 1000), // Tomorrow
        scheduled_time: '14:00',
        content_angle: trend.content_strategies[0] || { type: 'educational' },
        estimated_reach: trend.momentum_score * 100
      });
    }

    // TikTok - 1 week delay for trend building
    if (trend.momentum_score >= 75) {
      contentVariations.push({
        platform: 'tiktok',
        content_type: 'video',
        scheduled_date: new Date(baseDate.getTime() + 7 * 24 * 60 * 60 * 1000), // 1 week
        scheduled_time: '19:00',
        content_angle: trend.content_strategies[1] || trend.content_strategies[0],
        estimated_reach: trend.momentum_score * 150
      });
    }

    // LinkedIn - for B2B/professional angle
    if (trend.strategic_value === 'critical' || trend.matched_products.length >= 3) {
      contentVariations.push({
        platform: 'linkedin',
        content_type: 'article',
        scheduled_date: new Date(baseDate.getTime() + 14 * 24 * 60 * 60 * 1000), // 2 weeks
        scheduled_time: '09:00',
        content_angle: { type: 'thought_leadership', description: `Industry insights on ${trend.trend}` },
        estimated_reach: trend.momentum_score * 50
      });
    }

    duplicatePrevention.unique_opportunities.push({
      ...trend,
      duplicate_check_passed: true,
      content_variations: contentVariations,
      total_reach_potential: contentVariations.reduce((sum, v) => sum + v.estimated_reach, 0)
    });

    // Add to content planning
    contentVariations.forEach(variation => {
      duplicatePrevention.content_planning.push({
        trending_topic: trend.trend,
        ...variation,
        matched_products: trend.matched_products.slice(0, 3),
        content_hash: Buffer.from(
          `${trend.trend}:${variation.platform}:${variation.scheduled_date.toISOString()}`
        ).toString('base64').substring(0, 16)
      });
    });

  } else {
    duplicatePrevention.duplicates_found.push({
      trend: trend.trend,
      matches: duplicateMatches,
      action: 'Skipped - similar content exists'
    });
  }
});

// Generate summary
duplicatePrevention.summary = {
  total_trends_checked: productMatching.product_matching.matched_trends.length,
  unique_opportunities: duplicatePrevention.unique_opportunities.length,
  duplicates_prevented: duplicatePrevention.duplicates_found.length,
  content_pieces_planned: duplicatePrevention.content_planning.length,
  platforms_covered: [...new Set(duplicatePrevention.content_planning.map(c => c.platform))],
  estimated_total_reach: duplicatePrevention.unique_opportunities
    .reduce((sum, opp) => sum + opp.total_reach_potential, 0)
};

console.log('Duplicate check complete');
console.log('Unique opportunities:', duplicatePrevention.summary.unique_opportunities);
console.log('Content pieces planned:', duplicatePrevention.summary.content_pieces_planned);

return {
  json: duplicatePrevention
};

